import React from 'react';
import Head from 'next/head'
import { AppLayout } from '../components';

const Profile = () => {
  return (
    <AppLayout>
      <Head>
        <title>Profile | Next Tweet</title>
      </Head>
      <div>Profile</div>
    </AppLayout>
  );
};

export default Profile;
